import React from 'react';
import './NewLift.scss';

const NewLift = props => {
  const liftList = ["SQUAT", "BENCH PRESS", "DEADLIFT"];
  return (
    <div id="new-lift">
      <form id="lift-list">
          {liftList.map(lift => <input type="radio">{lift}</input>)}
      </form>
      <button type="button" onClick={props.toggleModal} className="button-one">
        CANCEL
      </button>
      <button type="button" onClick={props.toggleModal} className="button-one">
          ADD LIFT
      </button>
    </div>
  );
};

export default NewLift;
